import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Card, Button, Col, Row } from 'react-bootstrap';

const API_URL = 'https://realty-mole-property-api.p.rapidapi.com/properties';

const PropertyCards = () => {
  const [properties, setProperties] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    axios.get(API_URL, {
      headers: {
        'x-rapidapi-host': 'realty-mole-property-api.p.rapidapi.com',
        'x-rapidapi-key': 'YOUR_API_KEY_HERE', // Replace with your own API key
      },
    })
      .then((response) => {
        setProperties(response.data);
        setLoading(false);
      })
      .catch((error) => {
        console.log(error);
        setLoading(false);
      });
  }, []);

  if (loading) {
    return <p>Loading properties...</p>;
  }

  return (
    <div className="container">
      <div className="row">
        {properties.map((property) => (
          <div key={property.id} className="col-md-4 mb-3">
            <Card>
              <Card.Body>
                <Card.Title>{property.address.fullAddress}</Card.Title>
                <Card.Text>{property.description}</Card.Text>
                <ul>
                  <li>Price: {property.price}</li>
                  <li>Beds: {property.beds}</li>
                  <li>Baths: {property.baths}</li>
                  <li>Square footage: {property.sqft}</li>
                </ul>
                <Button variant="primary">View Property</Button>
              </Card.Body>
            </Card>
          </div>
        ))}
      </div>
    </div>
  );
};

export default PropertyCards;
